import React from 'react';
import './AboutUs.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import logo from "./dhuandhar.png"
import particle from 'react-particles'

function AboutUs() {
    return (
        <div className="about">
            <particle
                params={{
                    particles: {
                        number: {
                            value: 200,
                            density: {
                                enable: true,
                                value_area: 1000,
                            }
                        },
                    },
                }}>
                <div>
                    <h2>About Us</h2>
                    <p>
                        A Business Oriented Entreprenuer, an Aspirant Accountant,
                        and two freshly graduated Computer Science Engineers.
                        This small group of friends, help each other grow, and
                        challenge each other to be better each day. An initial
                        plan while chilling at a friend's place, took so many
                        expected and unexpected turns. Two months later,
                        here we are, presenting to you, DHUANDHAR.

                </p>

                    <p>
                        This is our initiative towards fulfilling your daily
                        requirements, needs and Desires. We present to you,
                        an application to Order Cigarettes, Hookah and Hookah
                        Essentials, and Snacks & Beverages. We guarantee you
                        delivery within the hour.

                </p>
                </div></particle>

        </div>
    )
}

export default AboutUs
